import React, { useEffect, useState } from "react";
import { useDispatch,useSelector } from "react-redux";
import './Landing.css'
import * as ProductActions from '../../store/products'


function Landing () {
const dispatch = useDispatch()
const products = useSelector(state=>state.products.allProducts)
useEffect(()=>{
    const products = async() =>{
        await dispatch(ProductActions.getAllProductThunk())
    }
    products()
},[dispatch])

if(Object.values(products).length===0){
    return null
}
const values = Object.values(products)

return (
    <>
    <h1>return Landing</h1>
    {values.map((element, index) => {
    if (index === 0) {
        return (
            <div key={index}>
                <img src={element.image} alt={`Image ${index}`} />
                <img src={element.image1} alt={`Image ${index + 1}`} />
                <img src={element.image2} alt={`Image ${index + 2}`} />
                <img src={element.image3} alt={`Image ${index + 3}`} />
            </div>
        );
    }
    })}
    </>
)
}


export default Landing
